import React, { Component } from 'react';
import axios from 'axios';

class Posts extends Component {
  constructor() {
    super();
    this.state = {
      posts: []
    };
    console.log(this.state.posts);
  }

  componentDidMount() {
    axios
      .get('https://jsonplaceholder.typicode.com/posts')
      .then(res => {
        const posts = res.data;
        this.setState({ posts });
      })
      .catch(err => {
        console.log(err);
      });
  }

  render() {
    return <div></div>;
  }
}

export default Posts;
